import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';

const app = {
  minHeight: '100vh',
  backgroundColor: 'wheat'
}

function App() {
  return (
    <div style={app}>
      <Navbar />
      <Footer />
    </div>
  );
}

export default App;
